import './AboutComp.css';
import {Link} from 'react-router-dom';

import React from 'react'

const AboutComp = () => {
  return (
    <div>
        <div className='about'>
            <div className='left'>
                <h1>Who am I </h1>
                <p>My name is Saud Ahmed Kadapa .Im a react Developer</p>
                <Link to="/contact">
                <button className='btn'>Contact</button></Link>
            </div>
        </div>
      
    </div>
  )
}

export default AboutComp
